        	/*
        	 gfn_UserAuth(39, 1) G_AUTH_LEVEL(2): 서비스사업부관리 담당 => 서비스사업부관리 담당 (SI, 기술, 연구, 외주)
        	 gfn_UserAuth(39, 2) G_AUTH_LEVEL(1): 인사관리 담당 => 인사관리 담당 (전체)
        	 gfn_UserAuth(39, 3) G_AUTH_LEVEL(3): 컨설팅 담당 권한 => 컨설팅 담당 (기술지원, si, 외주)
        	 gfn_UserAuth(39, 4) G_AUTH_LEVEL(4): 전임직원 조회 전용 => 전임직원 조회만 가능 (수정불가)
        						 G_AUTH_LEVEL(5): 팀장이상
        	*/
