        //row수를 맞추어 주는 작업
        this.fnSetDsSameHeight = function(ds1, ds2)
        {
        	var cnt1 = ds1.rowcount;
        	var cnt2 = ds2.rowcount;
        	var cntMax, dsMin;

        	if(cnt1 > cnt2)
        	{
        		cntMax = cnt1;
        		dsMin = ds2;
        	}
        	else if(cnt1 < cnt2)
        	{
        		cntMax = cnt2;
        		dsMin = ds1;
        	}
        	else
        	{
        		return;
        	}

        	while(dsMin.rowcount < cntMax)
        	{
        		dsMin.addRow();
        	}
        };

        this.replaceDocFieldAll = function(sParam, ds, ds2)
        {
        	var strRtn = "";
        	var rowCnt = ds.rowcount;

        	if(rowCnt == 0)
        	{
        		rowCnt = 2;
        	}

        	for(var i = 0, iL = rowCnt; i < iL; i++)
        	{
        		var str = sParam;
        		for(var c = 0, cL = ds.colcount; c < cL; c++)
        		{
        			var colId = ds.getColID(c);
        			str = this.replaceDocField(str, colId, ds, i);
        		}

        		if(ds2 != null)
        		{
        			for(var c = 0, cL = ds2.colcount; c < cL; c++)
        			{
        				var colId = ds2.getColID(c);
        				str = this.replaceDocField(str, colId, ds2, i);
        			}
        		}

        		strRtn += str;
        	}
        	return strRtn;
        };

        this.isUndefineCheck = function(chkVal)
        {
        	if(this.gfnIsEmpty(chkVal))
        	{
        		chkVal = "";
        	}

        	chkVal = chkVal.toString();

        	return chkVal;
        };

        this.replaceDocField = function(sDoc, sField, sValueDs, nValueDsIdx)
        {
        	var value = sValueDs.getColumn(nValueDsIdx, sField);

        	value = this.isUndefineCheck(value);

        	value = this.convertXmlToSource(value);

        	if((sField).indexOf("DATE") != -1 && (value.length >= 8 && nexacro.isNumeric(value)))	//NP:nexacro.isNumeric	, MP:isDigit
        	{
        		value = value.substr(0,4) + "-" + value.substr(4,2) + "-" + value.substr(6,2);
        	}

        	sDoc = sDoc.replace("{"+sField+"}", value);

        	return sDoc;
        };

        this.convertXmlToSource = function(str)
        {
        	var regExp1 = /\&/g;
        	str = str.replace(regExp1,",");

        	var regExp2 = /\\/g;
        	str = str.replace(regExp2,"&quot;");

        	var regExp3 = /\</g;
        	str = str.replace(regExp3,"&lt;");

        	var regExp4 = /\>/g;
        	str = str.replace(regExp4,"&gt;");

        	return str;
        };

