        		var dtFrom  = this.dsPrint3Output.getColumn(i, "START_DATE");
        		dtFrom = this.isUndefineCheck(dtFrom);
        		dtFrom = dtFrom.substr(0, 4) + "-" + dtFrom.substr(4,2) + "-" + dtFrom.substr(6,2);
        		var dtTo = this.dsPrint3Output.getColumn(i, "END_DATE");
        		dtTo = this.isUndefineCheck(dtTo);
        		dtTo = dtTo.substr(0, 4) + "-" + dtTo.substr(4,2) + "-" + dtTo.substr(6,2);
