        /************************************************************************************************
        * 각 COMPONENT 별 EVENT 영역
        ************************************************************************************************/
        this.div_Search_edt_ClientName_onkeydown = function(obj,e)
        {
        	if(e.keycode == 13)
        	{
        		if(!this.gfnIsEmpty(this.div_Search.form.edt_CompanyName.value))
        			this.fnSearch();
        		else
        			alert(this.gfnGetTransTxt(1577,"검색명을 입력하세요."));
        	}
        };

        this.comm_Click = function(obj,e)
        {
        	var PSE_SEQ = this.dsTotalProjectInfo.getColumn(this.dsTotalProjectInfo.rowposition, "PSE_SEQ");

        	switch(obj.name)
        	{
        		case "btn_CompanySearch" :
        			if(!this.gfnIsEmpty(this.div_Search.form.edt_CompanyName.value)) {
        				this.fnSearch();
        			} else {
        				this.gfnAlert('msg.err.validator.input',['검색어']);
        			}
        			break;
        		case "btn_NewCopy" :
        			if(this.dsOutput.rowcount >= 1)
        			{
        				this.dsOutputTemp.clearData();
        				this.dsOutput2Temp.clearData();
        				this.dsOutput3Temp.clearData();
        				this.dsOutput4Temp.clearData();
        				this.dsOutput5Temp.clearData();
        				this.dsOutput6Temp.clearData();
        				this.dsOutput7Temp.clearData();
        				this.dsOutput8Temp.clearData();

        				this.dsOutputTemp.copyData(this.dsOutput);
        				this.dsOutput2Temp.copyData(this.dsOutput2);
        				this.dsOutput3Temp.copyData(this.dsOutput3);
        				this.dsOutput4Temp.copyData(this.dsOutput4);
        				this.dsOutput5Temp.copyData(this.dsOutput5);
        				this.dsOutput6Temp.copyData(this.dsOutput6);
        				this.dsOutput7Temp.copyData(this.dsOutput7);
        				this.dsOutput8Temp.copyData(this.dsOutput8);

        				this.commUtil.popupCompanySearch(this, "CE_CompanySearch_Copy", "fnPopupCallBack", {});
        			}
        			else
        			{
        				this.alert(this.gfnGetTransTxt(1578,"복사할 데이터가 없습니다."));
        			}
        			break;
        		case "btn_Load" :
        			var edtVal = this.tab_TechInfo.tpg_SiInfo.form.div_EmpInfo.form.edt_EmpNo.value;

        			this.div_Search.form.btn_NewCopy.set_enable(false); //신규복사 버튼

        			var fnCopyDataset = function(dsTarget, dsSource, bAddrow)
        			{
        				var newrow = 0;
        				for(var i = 0, iL = dsSource.rowcount; i < iL; i++)
        				{
        					if(bAddrow)
        					{
        						newrow = dsTarget.addRow();
        					}
        					dsTarget.copyRow(newrow, dsSource, i);
        					dsTarget.setColumn(newrow, "EMP_NO", edtVal);
        				}
        			}

        			fnCopyDataset(this.dsOutput, this.dsOutputTemp, false);
        			fnCopyDataset(this.dsOutput2, this.dsOutput2Temp, true);
        			fnCopyDataset(this.dsOutput3, this.dsOutput3Temp, true);
        			fnCopyDataset(this.dsOutput4, this.dsOutput4Temp, true);
        			fnCopyDataset(this.dsOutput5, this.dsOutput5Temp, true);
        			fnCopyDataset(this.dsOutput6, this.dsOutput6Temp, true);
        			fnCopyDataset(this.dsOutput7, this.dsOutput7Temp, true);
        			fnCopyDataset(this.dsOutput8, this.dsOutput8Temp, true);

        			//덮어쓰기
        			//회사명
        			this.dsOutput.setColumn(0, "CO_NAME", this.G_CompanyName);
        			//회사코드
        			this.dsOutput.setColumn(0, "CO_CD", this.G_CompanyCode);
        			//사원번호
        			this.dsOutput.setColumn(0, "EMP_NO", edtVal);
        			//FIRE_DATE (default : 공백)
        			this.dsOutput.setColumn(0, "FIRE_DATE", null);
        			//재직여부 (default : 재직)
        			this.dsOutput.setColumn(0, "HOLD_OFFICE", "1");
        			break;
        		case "btn_Add" :
        			this.tab_TechInfo.tpg_SiInfo.form.fnsetEditReadonly(false); //TOBE 직원 아닐 때
        			this.div_Search.form.edt_CompanyName.set_value("");

        			this.dsOutput.clearData();
        			this.dsOutput2.clearData();
        			this.dsOutput3.clearData();
        			this.dsOutput4.clearData();
        			this.dsOutput5.clearData();
        			this.dsOutput6.clearData();
        			this.dsOutput7.clearData();
        			this.dsOutput8.clearData();

        			this.commUtil.popupCompanySearch(this, "CE_CompanySearch_New", "fnPopupCallBack", {"CompanyName" : "Optionchange"});
        			break;
        		case "btn_Del" :
        			this.fnDel(this.tab_TechInfo.tpg_SiInfo.form.div_EmpInfo.form.edt_EmpNo.value);
        			break;
        		case "btn_Save" :
        			this.fnSave();
        			break;
        		case "btn_ExcelSave":
        			if(this.dsOutput.rowcount < 1)
        			{
        				this.alert(this.gfnGetTransTxt(1253,"저장할 데이터가 없습니다."));
        			} else {
        				this.fnExcelEmpInfo();
        			}
        			break;
        		case "btn_WordSave" :
        			if (this.dsOutput.rowcount < 1) {
        				this.alert(this.gfnGetTransTxt(1579, "Word로 저장할 데이터가 없습니다."));
        			} else {
        				if (this.confirm(this.gfnGetTransTxt(1753, "신규양식으로 출력하시겠습니까?\n취소 시 구양식으로 출력됩니다."))) {
        					var docXml = this.fnMakeDocXml();

        					//윈도우에서 다운로드 작업시 필요.
        					this.printDoc(docXml, this.dsOutput.getColumn(0, "EMP_NAME") + " 개인이력카드(신).doc");
        				} else {
        					var docXml = this.fnMakeXml();

        					//윈도우에서 다운로드 작업시 필요.
        					this.printDoc(docXml, this.dsOutput.getColumn(0, "EMP_NAME") + " 개인이력카드(구).doc");
        				}
        			}
        			break;
        	}
        };

        this.printDoc = function(data, saveName) {
        	var downloadFile = function(type, data, saveName) {
        		var blob = new Blob([data],// Blob parts.
        		{
        			type: type
        		});
        		if (navigator.appVersion.toString().indexOf('.NET') > 0) {
        			window.navigator.msSaveBlob(blob, saveName);
        		} else {
        			var url = window.URL.createObjectURL(blob);
        			var ahref = document.createElement('a');
        			ahref.download = saveName;
        			ahref.href = url;

        			document.body.appendChild(ahref);
        			ahref.click();
        			document.body.removeChild(ahref);
        			ahref = null;
        		}
        	}

        	var fileData = data;
        	//xmlString;
        	var fileName = saveName;
        	//"file.doc";
        	var dataType = "text/xml;charset=utf-8";

        	downloadFile(dataType, fileData, fileName);
        };


